import React from "react";
import "./Styles/Home.scss";
import { Link } from "react-router-dom";
import { ImHome } from "@react-icons/all-files/im/ImHome";
import { IoNewspaper } from "@react-icons/all-files/io5/IoNewspaper";
import { FaPaperPlane } from "@react-icons/all-files/fa/FaPaperPlane";

function Home() {
    return (
        <div className="home">
            <Link to="/vesti" className="home-link">
                <div className="section">
                    <h1>Vesti</h1>
                    <div className="iconDiv">
                        <ImHome size={40} className="icon" />
                    </div>
                    <p>Vesti svih portala Sandzaka na jednom mestu</p>
                </div>
            </Link>
        </div>
    );
}

export default Home;
